import { useSelector } from "react-redux";
import { useGetAllProductsQuery } from "../features/productsApi";

const Home = () => {
    useSelector(state => state.products)
    const { data, error, isLoading } = useGetAllProductsQuery();
    return <h2>Home</h2>;
}

export default Home;
